import { Component} from '@angular/core';
interface Product {
  name: string;
  description: string;
  price: number;
}
@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  products: Product[] = [{
    name: "Đồng hồ 1",
    description: "Mô tả đồng hồ 1",
    price: 1000000
  }, {
    name: "Đồng hồ 2",
    description: "Mô tả đồng hồ 2",
    price: 2000000
  }];

  deleteProduct(product: Product) {
    const index = this.products.indexOf(product);
    if (index !== -1) {
      this.products.splice(index, 1);
    }
  }

}










<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title></title>


</head>
<div class="container">
	<h1 class="title">Quản lý sản phẩm đồng hồ</h1>
	<table class="product-table">
	  <thead>
		<tr>
		  <th>Tên sản phẩm</th>
		  <th>Mô tả</th>
		  <th>Giá</th>
		  <th>Hành động</th>
		</tr>
	  </thead>
	  <tbody>
		<tr *ngFor="let product of products">
		  <td>{{ product.name }}</td>
		  <td>{{ product.description }}</td>
		  <td>{{ product.price }} đồng</td>
		  <td>
			<button (click)="deleteProduct(product)" class="btn">Xóa sản phẩm</button>
		  </td>
		</tr>
	  </tbody>
	</table>
  </div>
<body>
<html>
